import React, { Component } from 'react'

const DailyTodos = (dailyTodos) =>{
    const displayTodos = dailyTodos.map(todo =>{
        return(
        <div className="onedailygoal" >
            <div className="onedailygoalheading">
                <h4>Programming</h4>Write Code
            </div>
        </div>
        )
    })
    return(
        <div className='test'>
            {displayTodos}
        </div>
    )
}
export default DailyGoals
